import React from "react";

import { Paper, Chip, TextField } from "@mui/material";
import AccountBoxIcon from "@mui/icons-material/AccountBox";

const ViewEmployee = () => {
  return (
    <div>
      <Paper elevation={3}>
        <Chip
          label="View Profile"
          color="primary"
          variant="outlined"
          icon={<AccountBoxIcon />}
        />

        <br></br>
        <TextField variant="standard" InputProps={{ readOnly: true }} />
      </Paper>
    </div>
  );
};

export default ViewEmployee;
